import React from "react";
import styled from "styled-components";
import {
  EducationDetail,
  FrameworkSkillContent,
  KBTGDetail,
  PersonalDetail,
  ProgrammingSkillContent,
  SCBTechX,
  Skooldio,
  SoftSkillContent,
  Work,
} from "../common/Content";
import Card from "../components/Card";
import ListCard from "../components/ListCard";
import "./Home.css";

const SkillWrapper = styled.div`
  display: flex;
  justify-content: space-between;
  margin-bottom: 16px;
`;

const WorkWrapper = styled(SkillWrapper)`
  flex-direction: column;
`;

// const HandleClick = () => {
//   window.scrollTo({ top: document.body.scrollHeight, behavior: "smooth" });
// };

export default function Home() {
  return (
    <>
      <Card img="profile_picture.png" content={PersonalDetail} border />
      <SkillWrapper>
        <ListCard
          border
          contents={ProgrammingSkillContent}
          title="Programming Skill"
        />
        <ListCard
          border
          contents={FrameworkSkillContent}
          title="Framework Skill"
        />
        <ListCard border contents={SoftSkillContent} title="Soft Skill" />
      </SkillWrapper>
      <SkillWrapper>
        <ListCard
          title="Bachelor of Engineering"
          contents={EducationDetail}
          border
        />
      </SkillWrapper>
      <WorkWrapper>

        Work Experiences
        <SkillWrapper>
          <ListCard border contents={KBTGDetail} title="KBTG" />
          <ListCard border contents={SCBTechX} title="SCB Tech X" />
          <ListCard border contents={Skooldio} title="Skooldio" />
        </SkillWrapper>
      </WorkWrapper>
    </>
  );
}
